import React from 'react';
import {Link} from 'react-router-dom'

function Home(props) {
    return (
        <div className="home">
            <h2>Porgress Bar</h2>
            <Link to="/selectWorkout"><h2>Select Workout</h2></Link>
            <div>
            <Link to="/createExercise"><h2>Create your Exercise</h2></Link>
            <Link to="/createWorkout"><h2>Create your Workout</h2></Link>

            </div>
        </div>
    );
}

export default Home;
